use crate::{fr::fr_from_gnark_bytes, point::*};
use ark_bn254::{Fq, Fq2, Fr, G1Affine, G2Affine};
use ark_ff::BigInteger256;
use ark_std::io::Read;
use std::error::Error;

// optimal Ate loop counter
pub(crate) const LOOP_COUNTER_SIZE: usize = 66;
pub(crate) const QCP_LEN_START_INDEX: usize = 368;
pub(crate) const QCP_LEN_END_INDEX: usize = QCP_LEN_START_INDEX + 4;

#[derive(Copy, Clone, Default, Debug)]
pub struct LineEvaluationAff {
    pub r0: Fq2,
    pub r1: Fq2,
}

// VerifyingKey used to verify opening proofs
#[derive(Copy, Clone, Debug)]
pub struct KzgVerifyingKey {
    pub g2: [G2Affine; 2], // [G₂, [α]G₂ ]
    pub g1: G1Affine,
    pub lines: Option<[[[LineEvaluationAff; LOOP_COUNTER_SIZE]; 2]; 2]>,
}

impl PartialEq for KzgVerifyingKey {
    fn eq(&self, other: &Self) -> bool {
        self.g2 == other.g2 &&
        self.g1 == other.g1 &&
        self.lines == other.lines
    }
}

#[derive(Clone, Default, Debug)]
pub struct VerifyingKey {
    pub size: u64,
    pub size_inv: Fr,
    pub generator: Fr,
    pub nb_public_variables: u64,

    // Commitment scheme that is used for an instantiation of PLONK
    pub kzg: KzgVerifyingKey,

    // cosetShift generator of the coset on the small domain
    pub coset_shift: Fr, 

    // S commitments to S1, S2, S3， 
    pub s: [G1Affine; 3],

    // Commitments to ql, qr, qm, qo, qcp prepended with as many zeroes (ones for l) as there are public inputs.
    // In particular Qk is not complete.
    pub ql: G1Affine,
    pub qr: G1Affine,
    pub qm: G1Affine,
    pub qo: G1Affine,
    pub qk: G1Affine,
    pub qcp: Vec<G1Affine>, 

    pub commit_constraint_indexes: Vec<u64>,
}

impl Default for KzgVerifyingKey {
    fn default() -> Self {
        KzgVerifyingKey {
            g2: [G2Affine::default(); 2],
            g1: G1Affine::default(),
            lines: None,
        }
    }
}

impl LineEvaluationAff {
    pub fn from_gnark_bytes(data: &[u8; 128]) -> Result<Self, Box<dyn Error>> {
        if data.len() != 128 {
            return Err("Invalid length".into())
        }
        let mut reader = &data[..];
         // Using slice directly

        let mut v_bytes = [0u8; 8];
        let mut val = [[0u64; 4]; 4];
        for i in 0..4 {
            for j in 0..4 {
                reader.read_exact(&mut v_bytes)?;
                let v = u64::from_be_bytes(v_bytes);
                val[i][j] = v;
            }
        }

        let r0_c0 = Fq::new_unchecked(BigInteger256::new(val[0]));
        let r0_c1 = Fq::new_unchecked(BigInteger256::new(val[1]));
        let r1_c0 = Fq::new_unchecked(BigInteger256::new(val[2]));
        let r1_c1 = Fq::new_unchecked(BigInteger256::new(val[3]));

        let eval = LineEvaluationAff {
            r0: Fq2::new(r0_c0, r0_c1),
            r1: Fq2::new(r1_c0, r1_c1),
        };

        Ok(eval)
    }
}

impl PartialEq for LineEvaluationAff {
    fn eq(&self, other: &Self) -> bool {
        self.r0 == other.r0 &&
        self.r1 == other.r1
    }
}

impl VerifyingKey {
    /*  
        have_lines= true, if this vk has lines
        have_lines= false, if this vk does not have lines. 
        lines are not necessary for verify, normally gnark will output a vk with lines, which is 32768 bytes.
        remove the lines for vk reside in canister for saving cycles.
     */

    pub fn from_gnark_bytes(data: &[u8], have_lines : bool) -> Result<Self, Box<dyn Error>> {
        let mut reader = data; // Using slice directly

        let mut size_bytes = [0u8; 8];
        let mut size_inv_bytes = [0u8; 32];
        let mut generator_bytes = [0u8; 32];
        let mut nb_pub_variables_bytes = [0u8; 8];
        let mut coset_shift_bytes = [0u8; 32];
        let mut s0_bytes = [0u8; 32];
        let mut s1_bytes = [0u8; 32];
        let mut s2_bytes = [0u8; 32];
        let mut ql_bytes = [0u8; 32];
        let mut qr_bytes = [0u8; 32];
        let mut qm_bytes = [0u8; 32];
        let mut qo_bytes = [0u8; 32];
        let mut qk_bytes = [0u8; 32];
        let mut qcp_len_bytes = [0u8; 4];
        //let mut qcp_bytes = [0u8; 32];
        let mut kzg_g1_bytes = [0u8; 32];
        let mut kzg_g2_0_bytes = [0u8; 64];
        let mut kzg_g2_1_bytes = [0u8; 64];
        let mut kzg_lines_bytes = [[[[0u8; 128]; LOOP_COUNTER_SIZE]; 2]; 2];
        let mut commitment_constraint_len_bytes = [0u8; 4];

        reader.read_exact(&mut size_bytes)?;
        reader.read_exact(&mut size_inv_bytes)?;
        reader.read_exact(&mut generator_bytes)?;
        reader.read_exact(&mut nb_pub_variables_bytes)?;
        reader.read_exact(&mut coset_shift_bytes)?;
        reader.read_exact(&mut s0_bytes)?;
        reader.read_exact(&mut s1_bytes)?;
        reader.read_exact(&mut s2_bytes)?;
        reader.read_exact(&mut ql_bytes)?;
        reader.read_exact(&mut qr_bytes)?;
        reader.read_exact(&mut qm_bytes)?;
        reader.read_exact(&mut qo_bytes)?;
        reader.read_exact(&mut qk_bytes)?;

        let size = u64::from_be_bytes(size_bytes);
        let size_inv = fr_from_gnark_bytes(&size_inv_bytes);
        let generator = fr_from_gnark_bytes(&generator_bytes);
        let nb_public_variables = u64::from_be_bytes(nb_pub_variables_bytes);
        let coset_shift = fr_from_gnark_bytes(&coset_shift_bytes);
        let s0_commit = gnark_compressed_x_to_g1_point(&s0_bytes)?;
        let s1_commit = gnark_compressed_x_to_g1_point(&s1_bytes)?;
        let s2_commit = gnark_compressed_x_to_g1_point(&s2_bytes)?;
        let ql_commit = gnark_compressed_x_to_g1_point(&ql_bytes)?;
        let qr_commit = gnark_compressed_x_to_g1_point(&qr_bytes)?;
        let qm_commit = gnark_compressed_x_to_g1_point(&qm_bytes)?;
        let qo_commit = gnark_compressed_x_to_g1_point(&qo_bytes)?;
        let qk_commit = gnark_compressed_x_to_g1_point(&qk_bytes)?;


        reader.read_exact(&mut qcp_len_bytes)?;
        let qcp_len = u32::from_be_bytes(qcp_len_bytes);
        let mut qcp_commits: Vec<G1Affine> = Vec::with_capacity(qcp_len as usize);
        for _i in 0..(qcp_len as usize) {
            let mut v_bytes = [0u8; 32];
            reader.read_exact(&mut v_bytes)?;
            let v = gnark_compressed_x_to_g1_point(&v_bytes)?;
            qcp_commits.push(v);
        }

        reader.read_exact(&mut kzg_g1_bytes)?;
        let kzg_g1 = gnark_compressed_x_to_g1_point(&kzg_g1_bytes)?;

        reader.read_exact(&mut kzg_g2_0_bytes)?;
        let kzg_g2_0 = gnark_compressed_x_to_g2_point(&kzg_g2_0_bytes)?;

        reader.read_exact(&mut kzg_g2_1_bytes)?;
        let kzg_g2_1 = gnark_compressed_x_to_g2_point(&kzg_g2_1_bytes)?;

        if have_lines{
            //decode lines
            for i in 0..2 {
                for j in 0..2 {
                    for k in 0..66 {
                        let mut v_bytes = [0u8; 128];
                        reader.read_exact(&mut v_bytes)?;
                        kzg_lines_bytes[i][j][k] = v_bytes;
                    }
                }
            }
        }

        reader
            .read_exact(&mut commitment_constraint_len_bytes)?;
        let commitment_constraint_len = u32::from_be_bytes(commitment_constraint_len_bytes);
        let mut commitment_constraint_bytes: Vec<[u8; 8]> =
            Vec::with_capacity(commitment_constraint_len as usize);
        for _ in 0..commitment_constraint_len {
            let mut v_bytes = [0u8; 8];
            reader.read_exact(&mut v_bytes)?;
            commitment_constraint_bytes.push(v_bytes);
        }

        let mut kzg_lines: [[[LineEvaluationAff; LOOP_COUNTER_SIZE]; 2]; 2] =
            [[[LineEvaluationAff::default(); LOOP_COUNTER_SIZE]; 2]; 2];
        if have_lines{    
            //decode lines
            for i in 0..2 {
                for j in 0..2 {
                    for k in 0..LOOP_COUNTER_SIZE {
                        let evl =
                            LineEvaluationAff::from_gnark_bytes(&kzg_lines_bytes[i][j][k])?;
                        kzg_lines[i][j][k] = evl;
                    }
                }
            }
        }

        let mut commit_constraint_indexes = vec![0u64; commitment_constraint_len as usize];
        for i in 0..commitment_constraint_len as usize {
            commit_constraint_indexes[i] = u64::from_be_bytes(commitment_constraint_bytes[i]);
        }

        let mut kzg_verifying_key = KzgVerifyingKey {
            g1: kzg_g1,
            g2: [kzg_g2_0, kzg_g2_1],
            lines: None,
        };

        if have_lines{
            kzg_verifying_key.lines = Some(kzg_lines);
        }

        let vk = VerifyingKey {
            size: size,
            size_inv: size_inv,
            generator: generator,
            nb_public_variables: nb_public_variables,
            kzg: kzg_verifying_key,
            coset_shift: coset_shift,
            s: [s0_commit, s1_commit, s2_commit],
            ql: ql_commit,
            qr: qr_commit,
            qm: qm_commit,
            qo: qo_commit,
            qk: qk_commit,
            qcp: qcp_commits,
            commit_constraint_indexes: commit_constraint_indexes,
        };
        Ok(vk)
    }

    //to_gnark_bytes_wo_lines, return vk without lines, remove lines for saving gas 
    pub fn to_gnark_bytes_wo_lines(data: &[u8], have_lines : bool) -> Result<Vec<u8>, Box<dyn Error>> {
        let mut qcp_len_bytes = [0u8;4];
        qcp_len_bytes.copy_from_slice(&data[QCP_LEN_START_INDEX..QCP_LEN_END_INDEX]);
        let qcp_len = u32::from_be_bytes(qcp_len_bytes);
        let total_qcp_len = 4 + 32 *qcp_len;

        let kzg_line_start_index = QCP_LEN_START_INDEX + total_qcp_len as usize + 160;
        let mut kzg_line_end_index = kzg_line_start_index;
        if have_lines{
            kzg_line_end_index = kzg_line_start_index + 128*4*LOOP_COUNTER_SIZE;
        };

        let mut res:Vec<u8> = vec![];
        res.extend_from_slice(&data[0..kzg_line_start_index]);
        res.extend_from_slice(&data[kzg_line_end_index..]);

        Ok(res)        
    }

    //test 2 vk equal without lines
    pub fn eq_wo_lines(&self, other: &Self) -> bool {
        self.size == other.size &&
        self.size_inv == other.size_inv &&
        self.generator == other.generator &&
        self.nb_public_variables == other.nb_public_variables &&
        self.kzg.g1 == other.kzg.g1 &&
        self.kzg.g2 == other.kzg.g2 &&
        self.coset_shift == other.coset_shift &&
        self.s == other.s &&
        self.ql == other.ql &&
        self.qr == other.qr &&
        self.qm == other.qm &&
        self.qo == other.qo &&
        self.qk == other.qk &&
        self.qcp == other.qcp &&
        self.commit_constraint_indexes == other.commit_constraint_indexes
    }

}

impl PartialEq for VerifyingKey {
    fn eq(&self, other: &Self) -> bool {
        self.size == other.size &&
        self.size_inv == other.size_inv &&
        self.generator == other.generator &&
        self.nb_public_variables == other.nb_public_variables &&
        self.kzg == other.kzg &&
        self.coset_shift == other.coset_shift &&
        self.s == other.s &&
        self.ql == other.ql &&
        self.qr == other.qr &&
        self.qm == other.qm &&
        self.qo == other.qo &&
        self.qk == other.qk &&
        self.qcp == other.qcp &&
        self.commit_constraint_indexes == other.commit_constraint_indexes
    }
}

