    #[test]
    fn test_lines_from_string() {
        let r0_c0_str =
            "12526022898296400651795766806094385957250154948087538066400573970250310727599";
        let r0_c1_str =
            "19721949927173216285937830292900680227211435498850903538587495844925581063472";
        let r1_c0_str =
            "4110752764440847029993710333296870396753666785458870337440969782289123199548";
        let r1_c1_str =
            "2524539108828422865916215076272533083788815095038371749085255761852573579569";

        let s = String::from("35cb910ae60ed023a4f68025147650672bd6c69cc847336c24be22f156cd0406acbc6d0ca7214c37f9d33b17fcd70e363e388581dcd39e030db3da1a713aa7525bb5cd18406322a105495cd8263863e46a2332de02a3139f166ebabeca8fde0b91f230f22e762ef3407b956e616b128ad1c5d24adb1f68ca12c302bcff7851d4");

        let bytes_vec = hex::decode(&s.clone()).unwrap();
        assert_eq!(128, bytes_vec.len());

        let mut reader = &bytes_vec[..]; // Using slice directly

        let mut v_bytes = [0u8; 8];
        let mut val = [[0u64; 4]; 4];
        let mut res_bytes: Vec<_> = vec![];
        for i in 0..4 {
            for j in 0..4 {
                reader.read_exact(&mut v_bytes).unwrap();
                let v = u64::from_be_bytes(v_bytes);
                val[i][j] = v;
                res_bytes.append(&mut v.to_be_bytes().to_vec())
            }
        }
        assert_eq!(s, hex::encode(res_bytes.clone()));

        let r0_c0 = Fq::new_unchecked(BigInteger256::new(val[0]));
        let r0_c1 = Fq::new_unchecked(BigInteger256::new(val[1]));
        let r1_c0 = Fq::new_unchecked(BigInteger256::new(val[2]));
        let r1_c1 = Fq::new_unchecked(BigInteger256::new(val[3]));

        let eval = LineEvaluationAff {
            r0: Fq2::new(r0_c0, r0_c1),
            r1: Fq2::new(r1_c0, r1_c1),
        };

        // println!("r0: {}", eval.r0);
        // println!("r1: {}", eval.r1);
        assert_eq!(r0_c0_str, eval.r0.c0.to_string());
        assert_eq!(r0_c1_str, eval.r0.c1.to_string());
        assert_eq!(r1_c0_str, eval.r1.c0.to_string());
        assert_eq!(r1_c1_str, eval.r1.c1.to_string());

        // println!("val: {:?}", eval);
    }

