    #[test]
    fn test_from_regular_to_montgomery() {
        /*
        // toMont converts z to Montgomery form
        // sets and returns z = z * r²
        func FromRegularToMontgomery(z fp.Element) *fp.Element {
            _z := z
            return _z.Mul(&_z, &rSquare)
        }

        func FromMontgomeryToRegular(z fp.Element) *fp.Element {
            _z := z
            return _z.Div(&_z, &rSquare)
        }
         */

        // mont_val = reg_val * r^2
        let mont_val = BigInteger256::new([
            3876351380277874723,
            11886829163236446311,
            3158930565324288876,
            2647592050879169542,
        ]);

        let reg_val = BigInteger256::new([
            2847909182188402607,
            18114098562207591663,
            6984339323239628593,
            1995510575793587181,
        ]);

        let reg_el = Fq::new(reg_val); //Fq::new build from regular form
        let mon_el = Fq::new_unchecked(mont_val); //build from montgomery form

        assert_eq!(
            "12526022898296400651795766806094385957250154948087538066400573970250310727599",
            reg_el.to_string()
        );
        assert_eq!(mon_el, reg_el);
    }


